   	protected function territory($territoryNum) {
		$territory = Territory::where('number', $territoryNum)->with(['publisher', 'addresses' => function ($query) {
		    $query->where('inactive', '!=', 1);
		}, 'addresses.street'  => function ($query) {
		    $query->orderBy('street', 'desc');
		}, 'addresses.notes'])->get();  //toArray();
		// dd($territory); 
		
		return [
			'number' => $territory[0]->number,
			'location' => $territory[0]->location,
			'date' => ($territory[0]->assigned_date != '0000-00-00') ? $territory[0]->assigned_date : date('Y-m-d', time()),
			'total' => count($territory[0]->addresses),
			'publisher' => !empty($territory[0]->publisher) ? $territory[0]->publisher->toArray() : null,
			'addresses' => $this->sortAddressByStreet($territory[0]->addresses->toArray())
		];
   	}
   	
   	protected function generatePdf($territoryArray) {
		$pdf = PDF::loadView('territory', $territoryArray);
		$pdf->setPaper(array(0, 0, 396, 612), 'portrait'); // Letterhalf
		// array(0, 0, 306, 396) = .36 of Letterhalf 
		// array(0, 0, 612, 792) = .36 of Letter = 1700 pixels x 2200 pixels
		/*
at 200 dpi:

A4 = 1654 pixels x 2339 pixels
A5 = 1165 pixels x 1654 pixels
Executive = 1450 pixels x 2100 px
Letter = 1700 pixels x 2200 pixels
Legal = 1700 pixels x 2800 pixels	
		*/	
		// $dompdf->set_paper(array(0, 0, 595, 841), 'portrait');
		// $pdf->setPaper("Letter", 'landscape');
		// $pdf->loadHTML($territoryHtmlTable);
		return $pdf->stream();
   	}
   	
   	protected function sortAddressByStreet($data) {
	   	if(!empty($data)) {
		   	$sortedAddress = [];
		   	foreach($data as $i => $address) {
			   	$sortedAddress[$address['street']['street']][] = $address;
		   	}
		   	return $sortedAddress;
	   	}
   	}
   	
   	protected function createHTMLTable($data, $type) {
	   	// return '<h1>Test</h1>';
	   	// dd($data);
	   	$htmlTable = '';
	   	if(!empty($data)) {
		   	$htmlTable = '<table width="100%">';
		   	$rows = '';
		   	foreach($data as $k => $v) {
			   	if($k == 0) $rows .= $this->getTableHeaders($v, $type) . $this->getTableRows($v, $type);
			   	else $rows .= $this->getTableRows($v, $type);
		   	}
		   	$htmlTable .= $rows . '</table>';
	   	}
	   	return $htmlTable; 
   	}
   	
   	protected function getTableHeaders($data, $type) {
	   	$rows = '<tr>';
	   	foreach($data as $k => $v) {
		   	if (in_array($k, self::$tableHeaders[$type])) 
		   		$rows .= '<th>'. ucfirst($k) .'</th>'; 
	   	}
	   	$rows .= '</tr>';
	   	return $rows;
   	}
   	
   	protected function getTableRows($data, $type) {
	   	// echo ' $type ' . $type;
	   	$rows = '<tr>';
	   	foreach($data as $k => $v) {
		   	if (in_array($k, self::$tableHeaders[$type])) {
			   	if (is_array($v) && count($v)) // dd($v); // dd($this->createHTMLTable($v, ucfirst($k)));
			   		$rows .= '<td>'. $this->createHTMLTable($v, ucfirst($k)) .'</td>';
			   	else if (!is_array($v)) $rows .= '<td>'. $v .'</td>';	
		   	} 
	   	}
	   	$rows .= '</tr>';
	   	return $rows;
   	}
   	
   	
   	
   	
   	/*** OUTPUT ALL TERRITORIES ***/	
   	
   	public function outputTerritory(Request $request, $number='') {
        if(!$number) { echo ' Parameter 1 "Territory Number" is required.'; exit; }
                
        // var_dump($this->territories); exit;
        
        // Get the number
        if($number<=10) $territories = $this->territories['1-10'];
        elseif($number<=20) $territories = $this->territories['11-20'];
        elseif($number<=30) $territories = $this->territories['21-30'];
        elseif($number<=40) $territories = $this->territories['31-40'];
        elseif($number<=50) $territories = $this->territories['41-50'];
        elseif($number<=60) $territories = $this->territories['51-60'];
        elseif($number<=70) $territories = $this->territories['61-70'];
        elseif($number<=80) $territories = $this->territories['71-80'];
        elseif($number<=90) $territories = $this->territories['81-90'];
        
        // CLEAN UP Encoding
        $search  = array('é', 'É', 'è', 'È', 'ò', 'ó', 'ï');
        $replace = array('&eacute;', '&Eacute;', '&egrave;', '&Egrave;', '&ograve;', '&oacute;', '&iuml;');
        $territories=str_replace($search, $replace, $territories);
        
		$territory_list = json_decode($territories);
		
		if($territory_list) {
			// var_dump($territory_list); exit;
			foreach($territory_list as $terr_item) {
                if($number==$terr_item->id) {
                    // $territory = json_encode($terr_item);
                    // header('Content-Type: application/json'); echo(json_encode($terr_item)); exit;
                     
                    self::restoreTerritory($terr_item); 
                    break;
                }
            }
        }     
		
	}
	
	
	// restoreTerritory
	protected static function restoreTerritory($data) {
		$territory = Territory::where('number', $data->terrNumber)->first();
		// var_dump($territory['id']); exit;
		
		if(empty($territory))
		$territory = Territory::create([
			'number' => $data->terrNumber,
			'location' => $data->street
		]);
		
		// var_dump($territory['id']); exit;
		
		if(!empty($territory['id'])) {
			$bad = ['STREET', 'COURT', 'PLACE', '(PARTIE SUD)', '(PARTIE NORD)', '(BILDING)',  '(BUILDING)'];
			$good = ['ST', 'CT', 'PL', '', '', '', ''];
			foreach($data->addresses as $i => $add) {
				$streetEntry = str_replace($bad, $good, strtoupper(Address::getStreet($add->address)));
				$street = Street::where('street', $streetEntry)->first();
				// var_dump($street); exit;
				
		        if(empty($street))
				$street = Street::create([
					'street' => $streetEntry,
					'is_apt_building' => 0
				]);
				else var_dump($streetEntry);
				
				
				// var_dump($street); exit;
				
				$addressEntry = strtoupper(trim(str_replace($streetEntry, '', $add->address)));
				$address = Address::where(['address' => $addressEntry, 'street_id' => $street['id']])->first();
				
				if(empty($address))
				$address = Address::create([
					'territory_id' => $territory['id'],
					'street_id' => $street['id'],
					'address' => $addressEntry,
					'name' => $add->name,
					'phone' => $add->phone
				]);
				else var_dump([$addressEntry, $address]);
				
				// var_dump($address); exit;
			}
		}
	}
	
	
